                                select new ChromosomeDB
                                {
                                    IdChromosome = g.Key                                    
                                }).ToList();

            List<ChromosomeDB> results = new List<ChromosomeDB>();

            foreach (var resultGroup in resultsGroup)
            {
                ChromosomeDB chromosome = new ChromosomeDB();

                chromosome.Genes = new List<GenDB>();

                chromosome.IdChromosome = resultGroup.IdChromosome;

                var list = (from l in lista where l.IdChromosome == resultGroup.IdChromosome select l).ToList();

                foreach (var gen in list)
                {
                    GenDB gendb = new GenDB();
                    gendb.IdFood = gen.IdFood;
                    gendb.NameFood = gen.NameFood;
                    gendb.NumberGen = gen.NumberGen;
                    gendb.ValueNutrient = gen.ValueNutrient;
                    chromosome.Genes.Add(gendb);
                }

                results.Add(chromosome);
            }           

            return results;
